import React, { useState } from 'react';
import styled from 'styled-components';

const AppDiv = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`
const Contact = styled.div`
  display: flex;
  align-items: center;
  text-align: center;
  width: 175px;
  height: 50px;
  margin: 50px 0px;
  margin-right: -500px;
  border-radius: 18px;
  background: #f2f2f2;
  box-shadow: 7px 7px 9px #d7d7d7, -7px -7px 9px #ffffff;
`

const ContactH2 = styled.h2`
  padding-top: 15px;
  color: #202225;
`
const Logo = styled.div`
  width: 300px;
  height: 300px;
  position: absolute;
  z-index: 1;
  margin-top: 50px;
`

const HeroBackground = styled.div`
  width: 650px;
  position: relative;
  height: 450px;
  margin-top: 50px;
  border-radius: 38px;
  background: #f2f2f2;
  box-shadow: 7px 7px 9px #d7d7d7, -7px -7px 9px #ffffff;
`

function App() {
  return (
    <AppDiv>
      <Contact><ContactH2>Contact Us</ContactH2></Contact>
      <Logo><img src="/assets/FoodDeliveryApp.png" alt=""/></Logo>
      <HeroBackground>

      </HeroBackground>
    </AppDiv>
  );
}

export default App;
